import ReactDOM from "react-dom";
import "./index.css";







const navbar = (
  <nav> 
    <img src="06 - React/React - 01 Building a static page/public/logo512.png" alt-text="Couldn't load"></img>
    <ul style="">
      <li>Tutorial</li>
      <li>Documentation</li>
      <li></li>
    </ul>
  </nav>
)

ReactDOM.render(navbar, document.getElementById('navbar'));
